import React from "react"
import Header from "./Header.js"
import MetrixMaker from "./MetrixMaker.js"


class App extends React.Component {
    constructor(props) {
        super(props)

        this.state = {
            currentPage: "Metric Maker"
        }
    }

    headerCallback = (data) => {
        console.log(data);
        this.setState({data});
    }

    render() {
        switch(this.state.currentPage) {
            case "Metric Maker":
                return (
                    <div>
                        <Header headerCallback={this.headerCallback}/>
                        <MetrixMaker />
                    </div>
                )
            case "Home":
                    return(
                        <div>
                            <Header headerCallback={this.headerCallback}/>
                        </div>
                    )
            default:
                return (
                    <div>

                    </div> 
                )
        }
    }
}

export default App
